import React from 'react';

const CarouselComponent = () => {
  return (
    <div id="controls-carousel" className="relative w-full" data-carousel="static">
      {/* Carousel wrapper */}
      <div className="relative h-72 overflow-hidden rounded-lg md:h-150">
        {/* Item 1 */}
        <div className="duration-700 ease-in-out" data-carousel-item>
          <img src="https://cdn.discordapp.com/attachments/1125374453220638731/1134006098106523770/inabatron_haired_girl_walking_in_a_forest_whimsical_cozy_fairy__7f634f44-1672-486e-99b2-14222951fb89.png" className="absolute block w-full -translate-x-1/2 -translate-y-1/2 top-1/2 left-1/2" alt="..." />
        </div>
        {/* Item 2 */}
        <div className="duration-700 ease-in-out" data-carousel-item="active">
          <img src="https://cdn.discordapp.com/attachments/1125374453220638731/1133366802211160114/inabatron_a_brown_haired_girl_in_a_whimsical_cozy_fairy_tale_ci_0c03d64d-75c6-4210-a6cd-5f9f46608760.png" className="absolute block w-full -translate-x-1/2 -translate-y-1/2 top-1/2 left-1/2" alt="..." />
        </div>
      </div>
    </div>
  );
};

export default CarouselComponent;
